const Config = (props) => {
    const [isStart, setIsStart] = useState(false)
    const handleStart = () => {
        setIsStart(true)
    }

    return (
        <div className='modal-wrapper'>
            <div className='modalContents'>
                <button onClick={setIsStart(true)}>start</button>
            </div>
        </div>
    )
}

export default Config
